selector_to_html = {"a[href=\"#solo-sandbox-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id6\" role=\"doc-backlink\">SOLO Sandbox Information</a><a class=\"headerlink\" href=\"#solo-sandbox-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#solo-header-requirements\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id13\" role=\"doc-backlink\">SOLO Header Requirements</a><a class=\"headerlink\" href=\"#solo-header-requirements\" title=\"Link to this heading\">#</a></h2><p>When making API requests, SOLO may require you to include additional headers:</p>", "a[href=\"#quick-start-postman\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id8\" role=\"doc-backlink\">Quick Start - Postman</a><a class=\"headerlink\" href=\"#quick-start-postman\" title=\"Link to this heading\">#</a></h2><p>You can also use the following steps to quickly get started with the API in Postman:</p>", "a[href=\"#id2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id10\" role=\"doc-backlink\">Requesting an Access Token in Postman - Bearer Token</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman-bearer-token\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#example-request-with-access-token\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id12\" role=\"doc-backlink\">Example Request With Access Token</a><a class=\"headerlink\" href=\"#example-request-with-access-token\" title=\"Link to this heading\">#</a></h3><p>Once you have an <cite>access_token</cite>, you can use it to make authenticated requests to the API.</p><p>Include it in the <cite>Authorization</cite> header as a Bearer token.</p>", "a[href=\"#obtaining-credentials\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id5\" role=\"doc-backlink\">Obtaining Credentials</a><a class=\"headerlink\" href=\"#obtaining-credentials\" title=\"Link to this heading\">#</a></h2><p>To access the API, you will need the following credentials:</p>", "a[href=\"#authentication\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Authentication<a class=\"headerlink\" href=\"#authentication\" title=\"Link to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id5\" role=\"doc-backlink\">Obtaining Credentials</a><a class=\"headerlink\" href=\"#obtaining-credentials\" title=\"Link to this heading\">#</a></h2><p>To access the API, you will need the following credentials:</p>", "a[href=\"#requesting-an-access-token-in-postman-oauth2-0-token\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id11\" role=\"doc-backlink\">Requesting an Access Token in Postman - OAuth 2.0</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman-oauth-2-0\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#requesting-an-access-token-in-postman-oauth-2-0\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id11\" role=\"doc-backlink\">Requesting an Access Token in Postman - OAuth 2.0</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman-oauth-2-0\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bug_reporting.html#bug-reporting\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bug Reporting<a class=\"headerlink\" href=\"#bug-reporting\" title=\"Link to this heading\">#</a></h1><p>Fill this form if you have any issues with either of the following:</p>", "a[href=\"#requesting-an-access-token-in-postman\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id9\" role=\"doc-backlink\">Requesting an Access Token in Postman</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman\" title=\"Link to this heading\">#</a></h2><h3><a class=\"toc-backref\" href=\"#id10\" role=\"doc-backlink\">Requesting an Access Token in Postman - Bearer Token</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman-bearer-token\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#requesting-an-access-token-in-postman-bearer-token\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id10\" role=\"doc-backlink\">Requesting an Access Token in Postman - Bearer Token</a><a class=\"headerlink\" href=\"#requesting-an-access-token-in-postman-bearer-token\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#quick-start-programmatically\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id7\" role=\"doc-backlink\">Quick Start - Programmatically</a><a class=\"headerlink\" href=\"#quick-start-programmatically\" title=\"Link to this heading\">#</a></h2><p>See below for how authentication should work in different languages.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
